// components/NavigationBar.js
import React from 'react';
import { Link } from 'react-router-dom';

const NavigationBar = () => {
  return (
    <nav>
          tab-size: 4;
    -webkit-text-size-adjust: 100%;
    -webkit-tap-highlight-color: rgba(0,0,0,0);
    --hello: #2bcadf;
    --save-search-size: 13px;
    --save-search-color: #555;
    --dropdown-menu-border-color: #ddd;
    --sticky-header-bg-color: #fafafa;
    --sticky-header-border-color: #c5c5c5;
    --ls-primary-green: #169b6a;
    --appointment-status-background: #4d84ff;
    --card-border: #dae6f0;
    --background-color: #f2f2f2;
    --gray-dark: #444;
    --back-to-top-shadow-color: rgba(0,0,0,0.05);
    --gray-lightest: #ccc;
    --default-color: #464646;
    --border-color: #707070;
    --primary-color: #fd3752;
    --white: #fff;
    --vh: 5.58px;
    line-height: inherit;
    color: #464646;
    font-size: 14px;
    font-family: Source Sans Pro,sans-serif;
    box-sizing: border-box;
    border: 0 solid;
    --tw-border-opacity: 1;
    border-color: rgba(229,231,235,var(--tw-border-opacity));
    --tw-shadow: 0 0 transparent;
    --tw-ring-inset: var(--tw-empty,/*!*/ /*!*/);
    --tw-ring-offset-width: 0px;
    --tw-ring-offset-color: #fff;
    --tw-ring-color: rgba(59,130,246,0.5);
    --tw-ring-offset-shadow: 0 0 transparent;
    --tw-ring-shadow: 0 0 transparent;
    position: fixed!important;
    top: 0!important;
    left: 0!important;
    z-index: 30!important;
    display: flex!important;
    width: 100%!important;
    -webkit-box-direction: normal!important;
    flex-direction: row!important;
    -webkit-box-orient: horizontal!important;
    flex-wrap: nowrap!important;
    -webkit-box-align: center!important;
    align-items: center!important;
    background-color: var(--white)!important;
    padding: 5px!important;
    height: 50px!important;
    -webkit-box-pack: center!important;
    justify-content: center!important;
    box-shadow: rgba(0, 0, 0, 0.11) 0px 2px 10px;
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
        <li>
          <Link to="/contact">Contact</Link>
        </li>
        <li>
          <Link to="/login">Login</Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavigationBar;
